export const setBlogs = (data) => {
    return { type: 'BLOGS', payload: data }
}

export const appendBlog = (data) => {
    return { type: 'NEW_BLOG', payload: data }
}

export const updateLikeBlog = (data) => {
    return { type: 'UPDATE_LIKE', payload: data }
}

export const setMessage = (data) => {
    return { type: 'SET_MESSAGE', payload: data }
}
